import React from "react";

const Header = () => {
    return(

        <div class="ui inverted segment">
        <div class="ui inverted secondary pointing menu">
            <a class="item">
            Home
            </a>
            <a class="item">
            Messages
            </a>
            <a class="item active">
            Friends
            </a>
        </div>
        </div>

    );
}

export default Header;
